De vijftienjarige Elizabeth uit New York wordt door haar vader en stiefmoeder naar familie in het Engelse platteland gestuurd. Daar ontmoet ze haar neven Osbert, Isaac en Edmond, nichtje Piper en haar tante Penn. Met deze mensen ontstaat na een moeizame start een speciale band. Ze wordt al snel verliefd op de telepathische Edmond. Als de derde wereld oorlog uitbreekt, valt de familie na een evacuatie uiteen.


